"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Bedwetting in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/bedwetting-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H46413168\">",
"      <span class=\"h1\">",
"       Is it normal for my child to wet the bed at night?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, it can be normal. Wetting the bed at night is common in young children. By age 4, most children can control their bladder when they are awake. But it can take longer for children to have control over their bladder when they are sleeping. Some children do not stop wetting the bed at night until they are 5 to 7 years old. Bedwetting is more common in boys than in girls, and can run in families.",
"     </p>",
"     <p>",
"      Most children will stop bedwetting on their own and do not need any treatment. But if you are worried or have questions about your child&rsquo;s bedwetting, talk with your child&rsquo;s doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46413175\">",
"      <span class=\"h1\">",
"       Why do children wet the bed?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Bedwetting is most likely to happen when:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A child&rsquo;s bladder muscles develop more slowly than usual",
"       </li>",
"       <li>",
"        A child&rsquo;s bladder holds a smaller than normal amount of urine",
"       </li>",
"       <li>",
"        A child&rsquo;s body makes a lot of urine",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most of the time, bedwetting is not caused by a medical or emotional problem. In some cases, though, it is. Your doctor should be able to tell if your child&rsquo;s bedwetting is caused by a medical problem.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46413182\">",
"      <span class=\"h1\">",
"       What can I do to try to stop my child&rsquo;s bedwetting?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can try different things at home to stop your child&rsquo;s bedwetting.",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Have your child urinate before going to bed. Remind him or her to wake up and use the toilet when needed.",
"       </li>",
"       <li>",
"        Put night lights in the hall and bathroom so your child can find the toilet easily.",
"       </li>",
"       <li>",
"        Stop using diapers or training pants at home, especially if your child is older than 8. Your child can still wear those items for overnight visits with family and friends.",
"       </li>",
"       <li>",
"        Have your child help with clean up in the morning. For example, he or she can take the wet sheet off the bed or help with laundry.",
"       </li>",
"       <li>",
"        Keep a chart of your child&rsquo;s progress and give rewards when your child stays dry. You and your child should agree on the rewards ahead of time.",
"       </li>",
"       <li>",
"        Spread out your child&rsquo;s drinks over the whole day. Do not have your child drink a lot right before bedtime.",
"       </li>",
"       <li>",
"        Help your child teach his or her bladder to hold more urine. Have your child hold his or her urine for longer periods of time before urinating.",
"       </li>",
"       <li>",
"        Use a night-time bedwetting alarm. Alarms work best in children ages 7 and older. Talk with your doctor about which type of alarm is best for your child and how to use it.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      For any of these plans to work, both you and your child must want the bedwetting to stop. Stopping bedwetting can be very hard to do and can take a long time.",
"     </p>",
"     <p>",
"      Remember that children cannot help their bedwetting. You should never get mad at, punish, or tease your child for wetting the bed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46413189\">",
"      <span class=\"h1\">",
"       Are there tips for how to keep my child&rsquo;s bed clean and dry?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Use a waterproof sheet to protect the mattress and avoid urine odor. When your child wets the bed at night, have him or her use the toilet before putting on dry pajamas. Then, put a dry towel on the wet part of the bed. You can also make the bed in layers, alternating sheets with waterproof pads. Then, when your child wets the bed, you can just take the wet sheet off without needing to re-make the bed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46413196\">",
"      <span class=\"h1\">",
"       When should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should see your doctor or nurse if your child:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feels the need to urinate more than usual",
"       </li>",
"       <li>",
"        Is more thirsty than usual",
"       </li>",
"       <li>",
"        Has a burning feeling when he or she urinates",
"       </li>",
"       <li>",
"        Has swelling of the feet or ankles",
"       </li>",
"       <li>",
"        Starts wetting the bed again after being dry for weeks or months",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      These symptoms can be a sign of a medical problem. Your child&rsquo;s doctor will want to check him or her. The doctor will do an exam and might order tests, including a urine test.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46413203\">",
"      <span class=\"h1\">",
"       Are there medicines that can reduce bedwetting?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are medicines doctors can prescribe to reduce bedwetting. But medicines are usually given to children older than 7 who have already tried many other ways to stop bedwetting.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46413210\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
