" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Percutaneous transhepatic cholangiography",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"mobipreview.htm?36/39/37491/contributors\">",
