var title_f36_39_37499="Negative symptoms in schizophrenia";
var content_f36_39_37499=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F81542&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F81542&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Negative symptoms in schizophrenia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Negative symptom",
"       </td>",
"       <td class=\"subtitle1\">",
"        As manifested by:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"6\">",
"        Affective flattening",
"       </td>",
"       <td>",
"        Unchanging facial expression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Little spontaneous movement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Little use of expressive gestures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Poor eye contact",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Affective non-responsivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lack of vocal inflections",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Alogia",
"       </td>",
"       <td>",
"        Poverty of speech",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thought blocking",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Increased latency of response",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"3\">",
"        Apathy",
"       </td>",
"       <td>",
"        Poor grooming and hygiene",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Failure of appropriate role responsibilities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anergy",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"4\">",
"        Asociality/anhedonia",
"       </td>",
"       <td>",
"        Failure to engage with peers socially",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No interest in stimulating activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Little interest in sex",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Little to no intimacy with others",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Andreasen NC. Negative symptoms in schizophrenia: Definition and reliability. Arch Gen Psychiatry 1982; 39:784. Copyright &copy; 1982 American Medical Association. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
