var title_f36_39_37500="EEG predictors of epilepsy";
var content_f36_39_37500=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F78039&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F78039&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Spike location and probability of epilepsy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Probability:",
"      </td>",
"      <td class=\"subtitle1\">",
"       Most often associated with:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       High probability of epilepsy (&gt;85 percent):",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Anterior-mid temporal spikes*",
"      </td>",
"      <td>",
"       Mesial temporal lobe epilepsy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Midline spikes&bull;",
"      </td>",
"      <td>",
"       Tonic-clonic seizures",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Hypsarrhythmia",
"      </td>",
"      <td>",
"       Infantile spasms (West syndrome)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Slow spike-wave",
"      </td>",
"      <td>",
"       Lennox-Gastaut Syndrome",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Generalized paroxysmal fast activity",
"      </td>",
"      <td>",
"       Lennox-Gastaut Syndrome",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Moderate probability of epilepsy (&lt;75 percent):",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Frontal spikes&Delta;",
"      </td>",
"      <td>",
"       Frontal lobe epilepsy",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Generalized spike-wave (&ge;3 Hz)",
"      </td>",
"      <td>",
"       Absence epilepsy (3 Hz; CAE, JAE), juvenile myoclonic epilepsy (&gt;3 Hz), and other primary generalized epilepsies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Centro-temporal spikes&loz;",
"      </td>",
"      <td>",
"       Benign rolandic epilepsy of childhoood (BREC)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Occipital spikes&sect;",
"      </td>",
"      <td>",
"       Benign focal epilepsy of childhood (Gastaut and Panayiotopolous syndromes: the 2 variants of CEOP)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Photoparoxysmal response",
"      </td>",
"      <td>",
"       Primary generalized epilepsy",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CAE: childhood absence epilepsy; JAE: juvenile absence epilepsy; BECTS: benign focal epilepsy of childhood with centrotemporal spikes; BREC: benign rolandic epilepsy of childhood; CEOP: childhood epilepsy with occipital paroxysms.",
"     <br>",
"      * &gt;90 percent probability of seizures/epilepsy (adults).&yen;",
"      <br>",
"       &bull; 76-91 percent probability of seizures/epilepsy (children).&Dagger;",
"       <br>",
"        &Delta; &sim;75 percent probability of seizures/epilepsy (children).&dagger;",
"        <br>",
"         &loz; &sim;40 percent probability of seizures/epilepsy (children).&dagger;",
"         <br>",
"          &sect; 50 percent probability of seizures/epilepsy (children).&dagger;",
"          <br>",
"           &yen; Pedley, TA, Mendiratta, A, Walczak, TS. Seizures and Epilepsy. In: Current Practice of Clinical Electroencephalography, Ebersole, JS, Pedley, TA (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2003 p.506.",
"           <br>",
"            &Dagger; Ehle, A, Co, S, Jones, MG. Clinical correlates of midline spikes. An analysis of 21 patients. Arch Neurol 1981; 38:355.",
"            <br>",
"             &dagger; Kellaway, P. The incidence, significance and natural history of spike foci in children. In: Current clinical neurophysiology: update on EEG and evoked potentials, Henry, C (Ed), Elsevier, Amsterdam 1981 p.151.",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Table modified and expanded from: Pillai, J, Sperling, MR. Interictal EEG and the diagnosis of epilepsy. Epilepsia 2006; 47 Suppl 1:14.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f36_39_37500=[""].join("\n");
var outline_f36_39_37500=null;
var title_f36_39_37501="Barthel Index";
var content_f36_39_37501=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F77371&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F77371&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Barthel Index",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Activity",
"       </td>",
"       <td class=\"subtitle1_single\">",
"        Score",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Feeding",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Unable",
"       </td>",
"       <td rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Needs help cutting, spreading butter, etc, or requires modified diet",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Independent",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Bathing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Dependent",
"       </td>",
"       <td rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Independent (or in shower)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Grooming",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Needs to help with personal care",
"       </td>",
"       <td rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Independent face/hair/teeth/shaving (implements provided)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Dressing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Dependent",
"       </td>",
"       <td rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Needs help but can do about half unaided",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Independent (including buttons, zips, laces, etc)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Bowels",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Incontinent (or needs to be given enemas)",
"       </td>",
"       <td rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Occasional accident",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Continent",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Bladder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Incontinent, or catheterized and unable to manage alone",
"       </td>",
"       <td rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Occasional accident",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Continent",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Toilet use",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Dependent",
"       </td>",
"       <td rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Needs some help, but can do something alone",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Independent (on and off, dressing, wiping)",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Transfers (bed to chair and back)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Unable, no sitting balance",
"       </td>",
"       <td rowspan=\"4\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Major help (one or two people, physical), can sit",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Minor help (verbal or physical)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        15 = Independent",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Mobility (on level surfaces)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Immobile or &lt;50 yards",
"       </td>",
"       <td rowspan=\"4\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Wheelchair independent, including corners, &gt;50 yards",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Walks with help of one person (verbal or physical) &gt;50 yards",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        15 = Independent (but may use any aid; for example, stick) &gt;50 yards",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Stairs",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0 = Unable",
"       </td>",
"       <td rowspan=\"3\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        5 = Needs help (verbal, physical, carrying aid)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10 = Independent",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td align=\"right\">",
"        <strong>",
"         Total (0-100):",
"        </strong>",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The Barthel ADL Index: Guidelines",
"    <br>",
"     <ul>",
"      <li>",
"       The index should be used as a record of what a patient does, not as a record of what a patient could do",
"      </li>",
"      <li>",
"       The main aim is to establish degree of independence from any help, physical or verbal, however minor and for whatever reason",
"      </li>",
"      <li>",
"       The need for supervision renders the patient not independent",
"      </li>",
"      <li>",
"       Patient performance should be established using the best available evidence provided by the patient, family, friends and caregivers; direct observation and common sense are also important, but direct testing is not needed",
"      </li>",
"      <li>",
"       Usually the patient's performance over the preceding 24 to 48 hours is important, but occasionally longer periods will be relevant",
"      </li>",
"      <li>",
"       Middle categories imply that the patient supplies over 50 percent of the effort",
"      </li>",
"      <li>",
"       Use of aids to be independent is allowed",
"      </li>",
"     </ul>",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      References:",
"      <br>",
"       <ol>",
"        <li>",
"         Mahoney FI, Barthel D. Functional evaluation: the Barthel Index. Maryland State Medical Journal 1965; 14:56. Used with permission.",
"        </li>",
"        <li>",
"         Loewen SC, Anderson BA. Predictors of stroke outcome using objective measurement scales. Stroke 1990; 21:78.",
"        </li>",
"        <li>",
"         Gresham GE, Phillips TF, Labi ML. ADL status in stroke: relative merits of three standard indexes.&rdquo; Arch Phys Med Rehabil 1980; 61:355.",
"        </li>",
"        <li>",
"         Collin C, Wade DT, Davies S, Horne V. The Barthel ADL Index: a reliability study. Int Disability Study 1988; 10:61.",
"        </li>",
"       </ol>",
"      </br>",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
